const Undo = (props) => {
    const {undo} = props;
    return (
        <button className="mr-1 border border-gray-500/50 text-gray-200/60 h-6 w-28 hover:bg-gray-500/50 hover:text-white transition-all" onClick={undo}>Undo</button>
    )
}

export default Undo
